# Unsupervised Learning

---




### Introduction

The agenda for this will be

- The Unsupervised Learning Problem
- K-means Clustering

---
### The Unsupervised Learning&lt;/br&gt; Problem

* No outcome variable/label, just a set of features.
* Objective is more fuzzy - find groups of samples that behave similarly, find features that behave similarly etc.
* Difficult to know how well you are doing.
* Different from supervised learning, but can be useful as a pre-processing step for supervised learning. 
---

### K-means 

K means is an archetypical clustering algorithm. It iterates between an assigment step and a update of centroid step.

.pull-left[
Training examples are shown as dots, and cluster centroids are shown as crosses. 

(a) Original dataset. 

(b) Random initial cluster centroids. 

(c-f) Illustration of running two iterations of k-means. In each iteration, we assign each training example to the closest cluster centroid (shown by "painting" the training examples the same color as the cluster centroid to which is assigned); then we move each cluster centroid to the mean of the points assigned to it. 

]
.pull-right[
![](images/kmeansViz.png)
]

---

### K-means 

Longitudes are from -180 to 180 and latitudes are from -90 to 90 e.g. they're measured in different units. We want to standardize them. Use the `scale()` function s.t. both `longitude` and `latitude` have zero mean and unit variance.


```r
coordinates &lt;- aarhus_apartments %&gt;% 
  select(longitude, latitude) %&gt;% 
  scale()
```

---

### The Elbow Method

The elbow method is a heuristic to select the number of clusters to use in k-means clustering.



&lt;img src="images/unsupervised-learning/unnamed-chunk-7-1.png" width="80%" /&gt;

---

### Create Final Model

Run the k-means algorithm 20 times with the selected k and select the configuration with minumum variance. K-means uses random sampling, therefore set a seed s.t. you're able to reproduce the result later.


```r
set.seed(42)
kmeans &lt;- kmeans(
  coordinates,
  centers = selected_k,
  nstart = 20
)
```

// adds .remark-code-has-line-highlighted class to <pre> parent elements

(function(d) {
  const hlines = d.querySelectorAll('.remark-code-line-highlighted');
  const preParents = [];
  const findPreParent = function(line, p = 0) {
    if (p > 1) return null; // traverse up no further than grandparent
    const el = line.parentElement;
    return el.tagName === "PRE" ? el : findPreParent(el, ++p);
  };

  for (let line of hlines) {
    let pre = findPreParent(line);
    if (pre && !preParents.includes(pre)) preParents.push(pre);
  }
  preParents.forEach(p => p.classList.add("remark-code-has-line-highlighted"));
